webpackJsonp([0xf927f8900006],{318:function(e,o){e.exports={data:{markdownRemark:{html:"<h3>What is The Programmer's hangout?</h3>\n<p>The programmer's hangout (TPH) is a discord community geared towards programming.\nThe use of the word \"geared\" here is important, because more accurately it's a discord\n<strong>for programmers</strong> of all kinds. If you're a totally green noob with 5 lines of code\nunder your belt, or if you're a veteran with 15 years of industry experience - TPH has a\nplace for you. More than that, there are over 13,500 people here. You can guarantee\nyou won't be the only person with your experience level on the server. </p>\n<h3>How do I join?</h3>\n<p>All you need to do is click (this link)[http://discord.gg/programming]. You also need a\ndiscord account. We recommend setting on up, then reading the <strong>#rules-and-info</strong> channel. </p>\n<h3>When was this server made?</h3>\n<p>This server was made on the 4th of November, 2016. </p>\n<h3>Who owns this server?</h3>\n<p>Fox#0001</p>\n<h3>Am I welcome?</h3>\n<p>If you're interested in programming, and you intend to abide by our rules, sure.</p>",frontmatter:{path:"/about",title:"About"}}},pathContext:{}}}});
